import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

const Logincomponent2 = () => {
  return (
    <Box>
      <Card>
      <CardMedia
        component="img"
        alt="This is product"
        className="image_Login"
        image={"https://i.pinimg.com/originals/97/21/05/972105c5a775f38cf33d3924aea053f1.jpg"}
      />
      </Card>
    </Box>
  );
};

export default Logincomponent2;
